import { blog_data } from "../Assets/assets";
function Blogitem() {

    const display = blog_data && blog_data.map((item,index)=> {
        return <>
        <div key={index}>
            
        </div>
        </>
    })
    return (
        <div id = "blogitem-div">
            <ul>
                <li>All</li>
                <li>Technology</li>
                <li>Startup</li>
                <li>Lifestyle</li>
            </ul>
        </div>
    )
}

export default Blogitem;
